import React, {useEffect, useState} from 'react';
import { makeStyles } from '@mui/styles'; 
import ProductList from './App/Page/ProductList';

const useStyles = makeStyles({
  root: {
    padding: '20px',  
  }, 
  card: { 
    maxWidth: 345, 
    margin: 'auto', 
    position: 'relative', 
  }, 
  media: {
    height: 140, 
  }, 
  deleteButton: {
    position: 'absolute', 
    top: 10, 
    right: 10, 
  },  
}); 

const App = () => {
  const classes = useStyles();  
  const [products, setProducts] = useState([]); 

  useEffect(() => {
    //Fetch a list of products from the backend
    fetch('http://localhost:5000/products')
    .then(response => response.json())
    .then(data => {
      setProducts(data); 
    })
    .catch(error => {
      console.error('Error fetching a list of products:', error);      
    }); 
  }, []); 

  return (
    <div>
      <ProductList />
    </div>
  );
};

export default App;
